/**
 * Static dictionary of common catalog item types to improve code readability.
 */
export class ItemType {
    /** @type {string} */
    static get Set(): string;
    /** @type {string} */
    static get Minifigure(): string;
    /** @type {string} */
    static get Part(): string;
    /** @type {string} */
    static get Book(): string;
    /** @type {string} */
    static get Gear(): string;
    /** @type {string} */
    static get Catalog(): string;
    /** @type {string} */
    static get Instruction(): string;
    /** @type {string} */
    static get UnsortedLot(): string;
    /** @type {string} */
    static get Box(): string;
}
